DROP TABLE IF EXISTS `likes`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `likes` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `from_user_id` int unsigned NOT NULL COMMENT 'Ссылка на пользователя лайкнувшего пост',
  `entity_id` int unsigned NOT NULL COMMENT 'Ссылка на другую сущность',
  `entity_name` varchar(128) NOT NULL COMMENT 'Ссылка на медиа',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `fk_likes_entity_name` (`entity_name`),
  CONSTRAINT `fk_likes_entity_name` FOREIGN KEY (`entity_name`) REFERENCES `entity_types` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Таблица лайков';
/*!40101 SET character_set_client = @saved_cs_client */;

